import React, { Component } from 'react';
import RoomsContainer from '../Coponent/RoomContainer';
import Navibar from '../Coponent/Navibar';
import Banner from '../Coponent/Banner';
import {Link} from 'react-router-dom';
import StyledHero from '../Coponent/StyleHero';
import img from '../images/defaultBcg.jpeg';

export default class Room extends Component {
    constructor(props){
        super(props);
        this.state = {
            se:[]
        }

    }

    render() {   
        return (
            <div className="room">
                <Navibar loggedinstatus={this.props.loggedinstatus}/>
                <StyledHero>
                    <Banner title = "Welcome">
                        <Link to="/"  className = "btn-room">
                            back to search page
                        </Link>
                    </Banner>
                </StyledHero>
                <RoomsContainer se={this.state.se}/> 
            </div>    
        );
    }
}
